import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import { Container } from "react-bootstrap";
import Slidebar from "./Slidebar";
import Permission from "./Permisson";
import BasicExample from "./Slidebardemo";

function SubElement() {
  return (
    <Container>
      <Row style={{border:'2px solid blue'}}>
        <Col  style={{border:'2px solid grey'}}>
          <Slidebar />
         <BasicExample/>
        </Col>
        <Col  style={{border:'2px solid green'}}>
          <Permission />
        </Col>
      </Row>
    </Container>
  );
}
export default SubElement;
